import React from 'react';

function PageTitle({ titleText, onClick }) {
    return (
        <div>
            <img src='./UI/UI_X.png' alt="Page Icon" />

            {onClick ? (
                <button onClick={onClick}>
                    !!!
                </button>
            ) : null}

            <h1>{titleText}</h1>
        </div>
    );
}

export default PageTitle;
